import './App.css';
import './component/Nav/Nav';
import BrainFlixLogo from './assets/Logo/Logo-brainflix.svg';

function App() {
  return (
    <div className="App">
      <nav className="nav"> 
      <img src={BrainFlixLogo} alt=''></img>
      <form>
          <label type='text' id='SearchBar' className='Nav__SearchBar' placeholder='Search'></label>
      </form>
      </nav>
    </div>
  );
}

export default App;
